      lastYearRevenue: "[EN]\u042D\u0442\u043E \u0441\u0443\u043C\u043C\u0430\u0440\u043D\u044B\u0435 \u0434\u043E\u0445\u043E\u0434\u044B \u043E\u0442 \u043F\u0440\u043E\u0434\u0430\u0436\u0438 \u043E\u0441\u043D\u043E\u0432\u043D\u044B\u0445 \u0432\u0438\u0434\u043E\u0432 \u043F\u0440\u043E\u0434\u0443\u043A\u0446\u0438\u0438 \u043F\u0440\u0435\u0434\u043F\u0440\u0438\u044F\u0442\u0438\u044F \u0438\u043B\u0438 \u0443\u0441\u043B\u0443\u0433. \u0414\u0430\u043D\u043D\u044B\u0435 \u0432\u0437\u044F\u0442\u044B \u0438\u0437 \u043E\u0442\u0447\u0435\u0442\u0430, \u0442.\u0435. \u043D\u0430\u0440\u0430\u0441\u0442\u0430\u044E\u0449\u0438\u043C \u0438\u0442\u043E\u0433\u043E\u043C \u0437\u0430 \u0430\u043D\u0430\u043B\u043E\u0433\u0438\u0447\u043D\u044B\u0439 \u043F\u0435\u0440\u0438\u043E\u0434 \u043F\u0440\u043E\u0448\u043B\u043E\u0433\u043E \u0433\u043E\u0434\u0430",
