      equity: "[EN]\u042D\u0442\u043E \u043E\u0431\u044A\u0435\u043C \u0441\u043E\u0431\u0441\u0442\u0432\u0435\u043D\u043D\u044B\u0445 \u0441\u0440\u0435\u0434\u0441\u0442\u0432 \u0430\u043A\u0446\u0438\u043E\u043D\u0435\u0440\u043E\u0432 \u043A\u043E\u043C\u043F\u0430\u043D\u0438\u0438, \u0438\u043D\u0432\u0435\u0441\u0442\u0438\u0440\u043E\u0432\u0430\u043D\u043D\u044B\u0445 \u0432 \u0431\u0438\u0437\u043D\u0435\u0441.",
